    const args = Array.from(arguments);
    const scope = args[4];
    const data = structuredClone(scope ? this.state[scope]?.originBackupData : this.state.originBackupData);
    const filterBackupData = this.utils.filter(...args, { data });
    const currentPage = args[0]?.current;
    const pageSize = args[0]?.pageSize;
    const pagination = this.getPagination(filterBackupData?.length, pageSize);
    const currentFilter = args[1] || {};
    const currentSort = args[2] || {};
    delete currentSort.column;
    const tableState = [
      structuredClone(args[0]),
      structuredClone(currentFilter),
      structuredClone(currentSort)
    ];
    if (scope) {
      this.setState({
        [scope]: {
          ...this.state[scope],
          filterBackupData,
          pageSize,
          pagination,
          currentPage,
          currentFilter,
          currentSort,
          tableState,
        }
      })
    } else {
      this.setState({
        filterBackupData,
        pageSize,
        pagination,
        currentPage,
        currentFilter,
        currentSort,
        tableState,
      });
    }
  }

  //查看备份记录
  async getBackupList(e, record) {
    const tableState = this.state.tableState;
    this.setState({ loading: true })
    const res = await this.dataSourceMap.listBackups.load();
    const _res = res?.items || [];
    // const sortItems = _.sortBy(_res, (item) => item.startTimestamp).reverse();

    const filterKeys = this.utils.getFilters(_res, [
      { "key": "backupRepo", "text": (v) => v == '' ? '--' : v },
      { "key": "autoBackup", "text": (v) => v ? this.i18n('auto') : this.i18n('manual') },
      { "key": "backupType", "text": (v) => v == 'Full' ? this.i18n('full') : this.i18n('pitr') },
      { "key": "status", "text": (v) => v == '' ? '--' : this.i18n(v) },
    ]);

    this.setState({
      originBackupData: _res,
      filterBackupData: _res,
      loading: false,
      filterKeys
    }, () => {
      if (tableState) {
        this.filterTable(...tableState);
      }
    })
  }

  //查看恢复记录
  async getRestoreList(e, record) {
    const res = await this.dataSourceMap.listRestores.load();
    const sortItems = res?.items ? _.sortBy(res?.items, (item) => item.status.startTimestamp).reverse() : [];
    this.setState({ restoreList: sortItems })
  }

  //查看某条备份详情
  async getClusterBackup(e, record) {
    const res = await this.dataSourceMap.getBackup.load({ backupId: record?.id});
    this.setState({ backupInfo: res, visible: true })
  }
  onCancel() {
    this.setState({ backupInfo: {}, visible: false })
  }

  onRestoreDetail(e, extParams) {
    this.setState({
      restoreVisible: true,
      restoreInfo: extParams
    })
  }

  onRestoreCancel() {
    this.setState({
      restoreVisible: false,
      restoreInfo: null,
    })
  }

  componentDidMount() {
    this.getBackupList();
    this.getRestoreList();
  }

}

